import styles from './SignUp.module.css'
import TextBox from '../TextBox/TextBox'
import { useNavigate } from 'react-router-dom';
import { useFormik } from 'formik';
import signUpSchema from '../Schemas/SignUpSchema';
function SignUp()
{
    const navigate = useNavigate();
    const HandleLogin = () => {
        navigate('/');
    }


    const {values, touched, handleBlur, handleChange, errors} = useFormik({
        initialValues: {
            "name":"",
            "phoneNumber":"",
            "address":"",
            "email":"",
            "password":"",

        },
        validationSchema: signUpSchema 
    })




    return(
        <div className={styles.mainPage}>
        <div className={styles.pageHeader}>
            Welcome to <span className={styles.logo}>CoinBounce</span>
        </div>
        <TextBox type="text" placeholder="Enter your Name" name="name" value={values.name} onChange={handleChange} onBlur={handleBlur} errormessage={errors.name} error={errors.name && touched.name ? 1 : undefined} />
        <TextBox type="password" placeholder="Enter your Phone Number" />
        <TextBox type="password" placeholder="Enter your Address" />
        <TextBox type="text" placeholder="Enter your Email" />
        <TextBox type="password" placeholder="Enter your Password" />
        <button onClick={HandleLogin} className={styles.LoginButton}>
            Create Account
        </button>
        </div>
    )
}

export default SignUp
